(function() {
  window.sfx_warning = function() {
    return window.sfx('warning');
  };

  window.sfx_success = function() {
    return window.sfx('success');
  };

  window.sfx = function(kind) {
    var s;
    s = $("#" + kind + "-fx")[0];
    if (Cookies.get('sound') === 'false') {
      return;
    }
    if (!s.play) {
      return;
    }
    s.pause();
    s.currentTime = 0;
    return s.play();
  };

}).call(this);
(function() {
  var Notifier,
    bind = function(fn, me){ return function(){ return fn.apply(me, arguments); }; };

  Notifier = (function() {
    function Notifier() {
      this["switch"] = bind(this["switch"], this);
      this.checkOrRequirePermission = bind(this.checkOrRequirePermission, this);
      if (!window.Notification) {
        this.removeSwitch();
      }
      this.getState();
      this.checkOrRequirePermission();
      $('input[name="notification-checkbox"]').bootstrapSwitch({
        labelText: gon.i18n["switch"].notification,
        state: this.switchOn(),
        onSwitchChange: this["switch"]
      });
    }

    Notifier.prototype.checkOrRequirePermission = function() {
      if (this.switchOn()) {
        if (Notification.permission === 'default') {
          return this.requestPermission(this.checkOrRequirePermission);
        } else if (Notification.permission === 'denied') {
          this.setStatus(false);
          return this.removeSwitch();
        }
      }
    };

    Notifier.prototype.removeSwitch = function() {
      return $('.desktop-real-notification').remove();
    };

    Notifier.prototype.setState = function(status) {
      this.enableNotification = status;
      return Cookies.set('notification', status, 30);
    };

    Notifier.prototype.getState = function() {
      return this.enableNotification = Cookies.get('notification');
    };

    Notifier.prototype.requestPermission = function(callback) {
      return Notification.requestPermission(callback);
    };

    Notifier.prototype["switch"] = function(event, state) {
      if (state) {
        this.setState(true);
        return this.checkOrRequirePermission();
      } else {
        return this.setState(false);
      }
    };

    Notifier.prototype.switchOn = function() {
      if (this.getState() === "true") {
        return true;
      } else {
        return false;
      }
    };

    Notifier.prototype.notify = function(title, content, logo) {
      var popup;
      if (logo == null) {
        logo = '/peatio-notification-logo.png';
      }
      if (this.enableNotification === true || this.enableNotification === "true") {
        if (window.Notification) {
          popup = new Notification(title, {
            'body': content,
            'onclick': onclick,
            'icon': logo
          });
        } else {
          popup = window.webkitNotifications.createNotification(avatar, title, content);
        }
        return setTimeout(((function(_this) {
          return function() {
            return popup.close();
          };
        })(this)), 8000);
      }
    };

    return Notifier;

  })();

  window.Notifier = Notifier;

}).call(this);
var RangerWebSocket = function(url){
    var callbacks = {};

    var conn;

    this.connect = function(){
        conn = new WebSocket(url);

        // dispatch to the right handlers
        conn.onmessage = function(evt){
            var json = JSON.parse(evt.data)
            if (json instanceof Array) {
                dispatch(json[0], json[1])
            } else {
                if (json['success']) {
                    console.log(json['success']['message'])
                } else {
                    notifier.notify(gon.i18n.notification.title, json['error']['message'])
                    alert(json['error']['message'])
                }
            }
        };

        conn.onerror = function(){dispatch('error',null)}
        conn.onclose = function(){dispatch('close',null)}
        conn.onopen = function(){dispatch('open',null)}
    }

    this.bind = function(event_name, callback){
        callbacks[event_name] = callbacks[event_name] || [];
        callbacks[event_name].push(callback);
        return this;// chainable
    };

    this.send = function(payload){
        conn.send( payload ); // <= send JSON data to socket server
        return this;
    };


    var dispatch = function(event_name, message){
        var chain = callbacks[event_name];
        if(typeof chain == 'undefined') return; // no callbacks for this event
        for(var i = 0; i < chain.length; i++){
            chain[i]( message )
        }
    }
};
(function() {
  var barongPath, query, ranger_address, ranger_scheme, stream;

  stream = ['global', "" + gon.market.id, 'order', 'trade'];

  query = {
    stream: stream
  };

  ranger_scheme = gon.ranger_connect_secure === "true" ? "wss://" : "ws://";

  ranger_address = ("" + ranger_scheme + gon.ranger_host + ":" + gon.ranger_port + "?") + $.param(query, true);

  barongPath = ("" + gon.barong_domain) + "/api/v1/sessions/jwt";

  window.ranger = new RangerWebSocket(ranger_address);

  if (gon.user) {
    ranger.bind('open', function() {
      console.info('Connection to Ranger has been established');
      return $.ajax({
        type: "POST",
        url: barongPath,
        async: true,
        xhrFields: {
          withCredentials: true
        },
        success: function(res) {
          console.info('Solving authorization challenge by sending JWT token');
          return ranger.send(JSON.stringify({
            jwt: "Bearer " + res
          }));
        }
      });
    });
  }

  ranger.connect();

}).call(this);
